;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"286\" height=\"215\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x4e9b5b53 \"BufferedImage@4e9b5b53: type = 10 ColorModel: #pixelBits = 8 numComponents = 1 color space = java.awt.color.ICC_ColorSpace@78d45103 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 286 height = 215 #numDataElements 1 dataOff[0] = 0\"]"}
