;; @@
(def img3 (-> image clone))
(def dst_gray (new-mat))
(def dst_color (new-mat))

; pencil-sketch! is broken
(pencil-sketch img3 dst_gray dst_color 60 0.07 0.05)
(g/>> dst_color)
(g/>> dst_gray)
